    Wildlife Refuge outlines Refuge accomplishments for the 2001 calendar year. The
    report begins with a summary of the yearu2019s highlights and climatic conditions.
    Monitoring and studies are also covered. Habitat management is discussed; topics
    include water levels, farming, and prescribed burning. The wildlife section of the
    report discusses nesting structures. Resource protection, public education and recreation,
    and planning and administration are also discussed. Photographs and Refuge brochures
